    constructor(props) {
        super(props)
        
        this.state = {
            username: '',
            password: '',
            failSignup: false
        }

    }

    

    render() {
        return (
            <div>
                <h1>Sign Up</h1>
                <div className="container">

                </div>
            </div>
        )
    }
}

